(92, 21, '', '\nThe valves between the atria and ventricles are called the atrioventricular valves. Between the right atrium and the right ventricle is the tricuspid valve. The tricuspid valve has three cusps,[20] which connect to chordae tendinae and three papillary muscles named the anterior, posterior, and septal muscles, after their relative positions.[20] The mitral valve lies between the left atrium and left ventricle. It is also known as the bicuspid valve due to its having two cusps, an anterior and a posterior cusp. These cusps are also attached via chordae tendinae to two papillary muscles projecting from the ventricular wall', '1', '', '', 0),
