INSERT INTO `gps_data_user` (`id`, `lat`, `lon`, `user`, `data`, `name`, `poza`) VALUES
(1, 52.2328, 21.0611, 27, 'Este cunoscut? pentru cercet?rile sale în domeniul elementelor radioactive, al radioactivit??ii naturale ?i al aplica?iilor acestora în medicin?', '	Marie Curie', 'static/homepic_med/27781532_1204524603011088_1469766569_n.png'),
(2, 51.8569, 2.2425, 12, ' Doctor britanic care a descoperit vacinul impotriva variolei', 'Edward Jenner', 'static/homepic_med/27720656_1204524703011078_756360312_n.png'),
(3, 51.1844, 7.22, 7, 'Razele electromagnetice sau razele X dupa cum sunt cunoscute', 'Wilhelm Conrad Röntgen', 'static/homepic_med/27847829_1204524746344407_1524298592_n.png'),
(4, 48.2206, 16.38, 234, 'A fost pionierul conceptului de resuscitare cardiopulmonara. Tehnica lui de respiratie gura la gura si masaj cardiac a salvat probabil milioane de vieti. Viena', 'Peter Safar ', 'static/homepic_med/27848448_1204525159677699_908040961_n.png'),
(5, 40.645, -73.9447, 234, 'A luat in 1976 premiul Nobel pentru medicina pentru meritul de a descoperi cum se raspandesc bolile infectioase. El a identificat totodata si virusul hepatitei B.', 'Baruch Blumberg ', 'static/homepic_med/27781026_1204525189677696_584411676_n.png'),
(6, 0, 0, 0, ' A descoperit primul agent antifungic eficient: nistatina, care este folosita si in zilele noastre pentru tratarea bolilor cauzate de ciuperci.', 'Elizabeth Lee Hazen', 'static/homepic_med/27781773_1204525216344360_1772270614_n.png'),
(7, 0, 0, 0, 'A facut cercetari si a introdus o terapie renumita in tratarea holerei ', 'David Nalin ', 'static/homepic_med/27720696_1204525283011020_788152050_n.png'),
(8, 0, 0, 0, 'A luat in 2008 premiul Nobel pentru medicina in urma descoperirii virusului HIV. Ea este virusolog la Insitutul Pasteur din Paris. ', 'Francoise Barre-Sinoussi ', 'static/homepic_med/27848313_1204525346344347_436907136_n.png'),
(9, 0, 0, 0, 'Este considerat parintele “pacemaker-ului”, dispozitivul care stimuleaza in mod artificial inima. El este chiar mandrul posesor al unui astfel de dispozitiv, deci putem spune la propriu ca a inovat pentru a-si salva viata. ', 'Vincent Gott ', 'static/homepic_med/27848820_1204525409677674_394659988_n.png'),
(10, 0, 0, 0, 'A castigat in 2003 premiul Nobel in medicina pentru munca  in domeniul rezonantei magnetice o tehnica imagistica raspandita acum in intreaga lume si care salveaza sute de mii de bolnavi, ajutandu-i sa fie diagnosticati mai repede in cazul afectiunilor grave ale creierului sau coloanei vertebrale. ', 'Paul Lauterbur ', 'static/homepic_med/27720925_1204525469677668_427273931_n.png');
